import React from "react";
import { AnimationStaggerMetadata } from "@angular/animations";


const Filtring=({keySearch , handleRating} )=>{

    return(
<div>
 
<div className="btn-filtring">
<input type="text" placeholder="Enter Movie Name" className="inputtext" onChange={(e)=>keySearch(e.target.value)}></input>


<StarRatingComponent  
          name="rate" 
          starCount={5}
          onStarClick={(value)=>handleRating(value)}
          starColor={"#ff8c00"}
          emptyStarColor={"#ffffff"}
        />
</div>
</div>
    )
}
export default Filtring;
